import React from 'react'

function Malakand() {
  return (
    <div>
      <h1>Malakand Regions:</h1>
      <button>Swat</button>
      <button>Malamjaba</button>
      <button>Kalam</button>
      <button>Mahudand</button>
    </div>
  )
}

export default Malakand;
